     style = {
      backgroundColor: "black",
    }
  }
  else {

       style = {
        backgroundColor: "white"
      }

    }


  return (
    <div className='HeaderNavbar' style={style} >
      <ul className='ulContainer'>
        <Link  to='/' className='NavElement'>Home</Link>
        <Link  to='/hall-of-art' className='NavElement' >Hall of Art</Link>
